import React from "react";
import ReactDOM from "react-dom/client";
import "./css/style.css";
import reportWebVitals from "./reportWebVitals";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  HashRouter,
} from "react-router-dom";

import Homepage from "./pages/homepage";

import Wellfare from "./pages/wellfare";
import Product from "./pages/product";
import Contact from "./pages/contact";

const App = () => {
  return (
    <>
      <Router>
        <Switch>
          <Route path="/espace_detente" exact element={<Homepage />}></Route>
          <Route
            path="/espace_detente/product/:_id"
            exact
            element={<Product />}
          ></Route>
          <Route
            path="/espace_detente/bien-etre"
            exact
            element={<Wellfare />}
          ></Route>
          <Route
            path="/espace_detente/contact"
            exact
            element={<Contact />}
          ></Route>
        </Switch>
      </Router>
    </>
  );
};

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <HashRouter>
      <App />
    </HashRouter>
  </React.StrictMode>
);

reportWebVitals();
